    function IsEmail(email){
        var exclude=/[^@\-\.\w]|^[_@\.\-]|[\._\-]{2}|[@\.]{2}|(@)[^@]*\1/;
        var check=/@[\w\-]+\./;
        var checkend=/\.[a-zA-Z]{2,3}$/;
        if(((email.search(exclude) != -1)||(email.search(check)) == -1)||(email.search(checkend) == -1)){
            return false;
        }
        else {
            return true;
        } 
    }
	
    $('#bt_auditar').click(function(){
        if (IsEmail($('#email_auditoria').val()) != true){
            $('#msg_auditoria').html('* Insira um e-mail válido');
            $('#email_auditoria').focus();
            return false;
        }
		if ($('#arquivoZipRar').val() != '') {
			if (comprova_extensao($('#arquivoZipRar').val()) != true){
				$('#msg_auditoria').html('* A extensão do arquivo deve ser .rar ou .zip');
				$('#arquivoZipRar').val('');
				return false;
			}
		} else {					
		}
		 $('#msg_auditoria').html('');
		 
		 options = {
		   dataType:  'json',
		   beforeSubmit:  function(){	
				$('#resposta_auditoria').show();
				$('#resposta_auditoria').html('<p>Ao concluir a auditoria, o resultado será enviado ao email informado.</p>')
				setTimeout(function() {
					$('#resposta_auditoria').hide();
				}, 7000 );
		   }
		 };
		 
		$('#arquivoZipRar').val(''); 
		$('#frmAuditoria').ajaxForm(options);
		$("#frmAuditoria").attr('action','/gerarauditoria');
		$('#frmAuditoria').trigger('submit');		
		$('#filename').val('');
		return false;
    });	
	
    function comprova_extensao(aArquivo) { 
        _extensoes_permitidas = new Array(".zip", ".rar"); 
        _error = ""; 
        if (!aArquivo) { 
            return false; 
        }else{ 
            extensao = (aArquivo.substring(aArquivo.lastIndexOf("."))).toLowerCase();             
            _permitida = false; 
            for (var i = 0; i < _extensoes_permitidas.length; i++) { 
                if (_extensoes_permitidas[i] == extensao) { 
                    _permitida = true; 
                    break; 
                } 
            } 
            if (!_permitida) { 
                return false; 
            }else{ 
                return true
            } 
        } 
    } 
	
	$("#arquivoZipRar").bind('change', function(){
		if (comprova_extensao($('#arquivoZipRar').val()) != true){
            $('#msg_auditoria').html('* A extensão do arquivo deve ser .rar ou .zip');
            $('#arquivoZipRar').val('');
            return false;
        }
		$('#msg_auditoria').html('');
		$('#aguardando_upload').hide();
		$('#mensagem_descompactacao').hide();		
		options = {
				dataType:  'json',
				beforeSubmit: function(){
					$('#bt_auditar').attr("disabled", true);
					$('#aguardando_upload').show();
					$('#mensagem_descompactacao').hide();
				},
				success: function(data){	
					$('#bt_auditar').attr("disabled", false);				
					try {
						$('#aguardando_upload').hide();	
						if (data.result == 'true'){
							$('#filename').val(data.mensagem);
						} else {
							$('#mensagem_descompactacao').html(data.mensagem).show();
							$('#filename').val('');
						}						
					} catch(e) {
						jError('Não foi possível realizar a validação. ', 'Erro');
					}
				},
				error: function(data){
					jAlert('Não foi possível enviar o arquivo. ', '');
				}
			}
		$('#frmAuditoria').ajaxForm(options);		
		$("#frmAuditoria").attr('action','/descompactararquivo');
		if ($('#arquivoZipRar').val() != ''){
			$('#frmAuditoria').trigger('submit');		
		}	
		return false;
	});	
		
